import React from 'react'
import style from './form.module.css'

export default function From() {

    const handName = (e) => {

        console.log(e.target.value);

    }


    const handEmail = (e) => {

        console.log(e.target.value);

    }


    const handPassword = (e) => {

        console.log(e.target.value);

    }

    const handForm = (e) => {

        console.log("From is called");
        // e.preventDefault();

    }





    return (
        <div >
            <h1>Register</h1>
            <form action="" onSubmit={handForm}>
                <div className={style.fromGroup}>

                    <label htmlFor="name">Name:</label>
                    <input type="text" name="name" id="name" onChange={handName} required />
                </div>



                <div className={style.fromGroup}>
                    <label htmlFor="email">Email:</label>
                    <input type="email" name="email" id="email" onChange={handEmail} required />
                </div>

                <div className={style.fromGroup}>
                    <label htmlFor="password">Password:</label>
                    <input type="password" name="password" id="password" onChange={handPassword} required />
                </div>


                <div className={style.fromGroup}>
                    <button type="submit"> Register</button>
                </div>

            </form>
        </div>
    )
}
